        FORTNITE_GIFT_INVENTORY_INFO:
          "F\xe5 utstyr som matcher {guardOutfitName}!\n\nFra 4. mai kan du l\xe5se opp Disccord-spillpremien {rewardName} ved \xe5 gj\xf8re en av to ting:\n\nStr\xf8mme direkte og skjermdele Fortnite p\xe5 Discord i minst 15 minutter til minst \xe9n Discord-venn.\n\nEtter \xe5 ha delt skjermen med en venn i 15 minutter mottar du en lenke som gave i Innstillinger > Gavebeholdning.\n\nKlikk p\xe5 lenken for \xe5 logge inn p\xe5 Epic-spillkontoen din, s\xe5 legges rullen i Fortnite-skapet ditt!\n\nIkke anledning til \xe5 str\xf8mme? Du kan ogs\xe5 ta p\xe5 deg Discord-botens oppdrag! F\xf8rste trinn er \xe5 bli med i [Fortnites offisielle Discord-server](http://discord.gg/fortnite).\n\nI serveren finner du en bot du kan kommunisere med for \xe5 starte Discord-oppdraget.\n\nN\xe5r du kommuniserer med boten, videresendes du til en side der du kan knytte sammen Epic- og Discord-kontoene dine.\n\nN\xe5r kontoene dine er knyttet sammen, m\xe5 du gj\xf8re en oppgave i Discord og en oppgave i Fortnite for \xe5 delta i oppdraget.\n\nN\xe5r begge oppgavene er klare, f\xe5r du rullen i Fortnite-skapet ditt!\n\nLes mer i blogginnlegget v\xe5rt!\n",
